import React from 'react';
import './App.css';
import { MuiButton, MuiTypography } from './Components/home';
import { Navigation } from './Components/NavLeiste';

function App() {
  return (
    <div className="App">
      <Navigation />
      <MuiTypography />
      <MuiButton />
    </div>
  );
}

export default App;
